import React from 'react'
import Obj from './component/Obj';

const MapMethod = (props) => {
    return (
        <>
            <ul>
                <li>{props.id}</li>
                <li>{props.name}</li>
                <li>{props.sub}</li>
            </ul>
        </>
    )
}
export default MapMethod;
